import React from 'react';
import styled from 'styled-components';
import Header from './Header'

const Style = styled.div`
	position: fixed;
	top: 0;
	width: 100%;
	padding: 0px 5rem 0px 1rem;

	background-color: #2b2b2b;
`;

const Navbar = () => {
	return(
		<Style>
			<Header></Header>
		</Style>
	);
}

export default Navbar;
